import React from 'react';

const About = () => {
    return (
        <div>
            <h1>About Us</h1>
            <p>
                Welcome to Rustaco Eventos, a dedicated organization for competitive Rust tournaments in Latin America. 
                Our mission is to bring together players from all over the region to showcase their skills, 
                foster community, and promote the spirit of competition.
            </p>
            <p>
                Since our inception, we have organized numerous events that cater to players of all skill levels. 
                Our team is passionate about creating a fun and engaging environment for everyone involved. 
                Join us as we continue to grow and elevate the competitive Rust scene!
            </p>
        </div>
    );
};

export default About;
